import React from "react";

export default function UserPage(){

    return(
        <div>
            <AddBoat/>
            <UpdateBoat/>
            <OwnedBoats/>
        </div>
    )
}

function AddBoat(){

    return(
        <div>
            <h1>Add Boat</h1>
        </div>
    )
}

function UpdateBoat(){
    return(
        <div>
            <h1>Update Boat</h1>
        </div>
    )
}

function OwnedBoats(){
    return(
        <div>
            <h1>Owned Boats</h1>
        </div>
    )
}
